-- ----------------------------
--  View definition for `v_cta_cte`
-- ----------------------------
DROP VIEW IF EXISTS `v_cta_cte`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_cta_cte` AS select `e`.`NRO_GUIA` AS `NRO_GUIA`,`e`.`PRECIO` AS `PRECIO`,`e`.`COMISION_COMISIONISTA` AS `COMISION_COMISIONISTA`,`e`.`COMISION_SUCURSAL` AS `COMISION_SUCURSAL`,`cl`.`nombre` AS `nombre`,`cl`.`codigo` AS `codigo`,`cl`.`razon_social` AS `razon_social`,`ps`.`NOMBRE_Y_APELLIDO` AS `NOMBRE_Y_APELLIDO`,`ps`.`FECHA` AS `fecha_pasaje`,`p`.`importe` AS `importe_pago`,`e`.`PRECIO` AS `importe_encomienda`,`ps`.`PRECIO` AS `importe_pasaje`,`cc`.`fecha` AS `fecha_ctacte` from ((((`ctactes` `cc` join `clientes` `cl` on((`cc`.`id_cliente` = `cl`.`codigo`))) left join `encomiendas` `e` on((`cc`.`id_encomienda` = `e`.`NRO_GUIA`))) left join `pagos` `p` on((`cc`.`id_pago` = `p`.`codigo`))) left join `pasajes` `ps` on((`cc`.`id_pasaje` = `ps`.`CODIGO`))) ;

-- ----------------------------
--  View definition for `v_detalle_factura`
-- ----------------------------
DROP VIEW IF EXISTS `v_detalle_factura`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sergio`@`10.20.12.37` SQL SECURITY DEFINER  VIEW `v_detalle_factura` AS select concat_ws(`p`.`CODIGO`,`ve`.`codigo`,`e`.`NRO_GUIA`) AS `codificacion`,concat_ws(`e`.`FECHA`,`p`.`FECHA`,`ve`.`fecha_salida`) AS `fecha_generada`,`f`.`FECHA` AS `fecha_factura` from (((`facturas` `f` join `encomiendas` `e` on((_utf8'' = _utf8''))) join `pasajes` `p`) join `viajes_especiales` `ve`) where ((`f`.`CODIGO` = _utf8'p.id_factura') or (`f`.`CODIGO` = _utf8've.id_factura') or (_utf8'f.codigo' = _utf8'e.id_factura')) ;

-- ----------------------------
--  View definition for `v_pasajes_vendidos_con_pagos`
-- ----------------------------
DROP VIEW IF EXISTS `v_pasajes_vendidos_con_pagos`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_pasajes_vendidos_con_pagos` AS select 'pj' AS `A`,concat(`p`.`ID_VIAJE`,'-',`p`.`CODIGO`) AS `nropasaje`,`p`.`ID_VIAJE` AS `ID_VIAJE`,`p`.`CODIGO` AS `CODIGO`,`p`.`DNI` AS `DNI`,`p`.`NOMBRE_Y_APELLIDO` AS `NOMBRE_Y_APELLIDO`,`p`.`DIRECCION_ORIGEN` AS `DIRECCION_ORIGEN`,`p`.`DIRECCION_DESTINO` AS `DIRECCION_DESTINO`,`ld`.`localidad` AS `loc_destino`,`lo`.`localidad` AS `loc_origen`,`p`.`PAGADO` AS `PAGADO`,`p`.`FECHA` AS `FECHA`,`p`.`ID_PERSONAL` AS `ID_PERSONAL`,`p`.`NOMBRE_PERSONA_SEGURO` AS `NOMBRE_PERSONA_SEGURO`,`p`.`DNI_PERSONA_SEGURO` AS `DNI_PERSONA_SEGURO`,`p`.`FECHA_NAC_PERSONA_SEGURO` AS `FECHA_NAC_PERSONA_SEGURO`,`p`.`VALOR_SEGURO` AS `VALOR_SEGURO`,`p`.`PRECIO` AS `PRECIO`,(`p`.`PRECIO` + coalesce(`p`.`VALOR_SEGURO`,0)) AS `Total`,`p`.`USUARIO` AS `USUARIO`,`p`.`ID_TIPO_PASAJE` AS `ID_TIPO_PASAJE`,0 AS `forma_pago`,0.00 AS `importe_pago`,'-' AS `fecha_emision`,'-' AS `nro_cheque`,0.00 AS `importe_chq`,0.00 AS `Comision`,`pg`.`procesado` AS `procesado`,`pg`.`fecha_procesado` AS `fecha_procesado`,`s`.`nombre` AS `sucursal` from ((((((`pasajes` `p` join `localidades` `lo` on((`p`.`ID_LOCALIDAD_ORIGEN` = `lo`.`codigo`))) join `localidades` `ld` on((`p`.`ID_LOCALIDAD_DESTINO` = `ld`.`codigo`))) left join `pagos` `pg` on((`pg`.`id_pasaje` = `p`.`CODIGO`))) join `usuarios` `u` on((`p`.`USUARIO` = `u`.`usuario`))) join `conf_usuario` `cu` on((`u`.`id_configuracion_usuario` = `cu`.`codigo`))) join `sucursales` `s` on((`cu`.`id_sucursal` = `s`.`codigo`))) union select 'pg' AS `A`,concat(`p`.`ID_VIAJE`,'-',`p`.`CODIGO`) AS `nropasaje`,`p`.`ID_VIAJE` AS `ID_VIAJE`,`p`.`CODIGO` AS `CODIGO`,'-' AS `DNI`,'-' AS `NOMBRE_Y_APELLIDO`,'-' AS `DIRECCION_ORIGEN`,'-' AS `DIRECCION_DESTINO`,'-' AS `loc_destino`,'-' AS `loc_origen`,'V' AS `PAGADO`,`pg`.`fecha` AS `FECHA`,'-' AS `ID_PERSONAL`,'-' AS `NOMBRE_PERSONA_SEGURO`,'-' AS `DNI_PERSONA_SEGURO`,'-' AS `FECHA_NAC_PERSONA_SEGURO`,0.00 AS `VALOR_SEGURO`,0.00 AS `PRECIO`,0.00 AS `Total`,`p`.`USUARIO` AS `USUARIO`,'-' AS `ID_TIPO_PASAJE`,`pg`.`forma_pago` AS `forma_pago`,`pg`.`importe` AS `importe_pago`,concat(`ch`.`fecha_emision`,'-') AS `fecha_emision`,concat(`ch`.`nro_cheque`,'-') AS `nro_cheque`,concat(`ch`.`importe`,0) AS `importe_chq`,((`pg`.`importe` * 7) / 100) AS `Comision`,`pg`.`procesado` AS `procesado`,`pg`.`fecha_procesado` AS `fecha_procesado`,`s`.`nombre` AS `sucursal` from (((((`pasajes` `p` join `pagos` `pg` on((`pg`.`id_pasaje` = `p`.`CODIGO`))) left join `cheques` `ch` on((`pg`.`id_cheque` = `ch`.`codigo`))) join `usuarios` `u` on((`p`.`USUARIO` = `u`.`usuario`))) join `conf_usuario` `cu` on((`u`.`id_configuracion_usuario` = `cu`.`codigo`))) join `sucursales` `s` on((`cu`.`id_sucursal` = `s`.`codigo`))) order by `ID_VIAJE`,`CODIGO` desc ;

