-- ----------------------------
--  Procedure definition for `crear_viajes_diarios_auto`
-- ----------------------------
DROP PROCEDURE IF EXISTS `crear_viajes_diarios_auto`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `crear_viajes_diarios_auto`(IN `var_fecha` date)
BEGIN

/*---------------------------------------------------------------------------------------------------
// crea en la tabla VIAJES un registro por cada salida diaria tenga en la tabla SALIDA
//---------------------------------------------------------------------------------------------------*/
IF  (not EXISTS(SELECT * FROM viajes  WHERE fecha = var_fecha)) THEN
	INSERT INTO viajes (id_salida, estado, fecha)
		SELECT s.codigo, 'N',  var_fecha
		FROM salidas AS s
		WHERE s.activa = 'S' AND s.tipo_salida = 'D';
 END IF;

END
;;
